import React from 'react';
import './task2.css';
class Task2 extends React.Component{
    constructor(){
        super()
        this.state={message:''}
    } 
    change(){
        this.setState({message:"Hello"})
    }
    render(){
        return(
            <div>
                <button onClick={()=>this.change()}>Item1</button>
                <h1>{this.state.message}</h1>
                <button>Item2</button>
                <button>Item3</button>
                <button>Item4</button>
            </div>
        )
    }
}
export default Task2;
